import React, { useEffect, useState } from "react";

export default function Income() {
  const [income, setIncome] = useState([]);

  const getIncome = () => {
    const url = "http://localhost:8000/income";

    fetch(url)
      .then((response) => response.json)
      .then((data) => setIncome(data));
  };

  useEffect(getIncome, []);

  const getRows = () => {
    const rows = income.map((entry) => {
      return (
        <tr>
          <td>{entry.id}</td>
          <td>{entry.concept}</td>
          <td>{entry.amount}</td>
          <td>{entry.date}</td>
          <td>{entry.category}</td>
        </tr>
      );
    });
  };
  return (
    <table className="table">
      <thead>
        <tr>
          <th>ID</th>
          <th>Concept</th>
          <th>Amount</th>
          <th>Date</th>
          <th>Category</th>
        </tr>
      </thead>
      <tbody>{getRows()}</tbody>
    </table>
  );
}
